data:
  ChatPhoto:
    fields:
      big_file_id:
        description: File identifier of big (640x640) chat photo. This file_id can
          be used only for photo download and only for as long as the photo is not
          changed.
        name: big_file_id
        required: true
        types:
        - String
      big_file_unique_id:
        description: Unique file identifier of big (640x640) chat photo, which is
          supposed to be the same over time and for different bots. Can't be used
          to download or reuse the file.
        name: big_file_unique_id
        required: true
        types:
        - String
      small_file_id:
        description: File identifier of small (160x160) chat photo. This file_id can
          be used only for photo download and only for as long as the photo is not
          changed.
        name: small_file_id
        required: true
        types:
        - String
      small_file_unique_id:
        description: Unique file identifier of small (160x160) chat photo, which is
          supposed to be the same over time and for different bots. Can't be used
          to download or reuse the file.
        name: small_file_unique_id
        required: true
        types:
        - String
    kind: struct
    meta:
      description:
      - This object represents a chat photo.
      href: https://core.telegram.org/bots/api#chatphoto
      name: ChatPhoto
